After today's 12km run, I hit this lower body strenght training session in the gym, I try and do at least two lower body sessions a week to build strength in my legs to improve my running, reduce my chance of injury and of course,  build some muscle for those aesthetic quadsüí™üèæ. I added in some side delts and biceps to this workout as I like to hit them frequently and in my case they require quite a lot of training volume to grow. 

Superset 1: 4 rounds 
Weighted Bulgarian split squats 6-8 reps
Side lateral raise 12-15 reps 

Superset: 2 rounds 
Goblet squat 6-8 reps 
Bicep curls 10-12 reps 

Superset 3: 2 rounds 
Leg extensions 15-20 reps 
Calf press 

Finished off with 2 more sets if calf press! 

Between each round, 2 min rest. 

Note: a superset is when you do one exercise and directly go into the other exercise without any rest and you take rest once you have finished the two exercises.

Swipe left to see the rest of the workout! 
